import Navigation from '../Navigation/Navigation';

export default function CompareTwoPlayers() {
  // Navigation is the nav bar that stays at the top
  return (
    <div>
      <Navigation />
      <div>
        <header>
          <p>
              Here is the Compare Two Players page!
          </p>
        </header>
      </div>
    </div>
  );
};
